import { style } from "typestyle";

const HowItWorkStyle = style({
    position: 'relative',
    backgroundColor: 'white',
    height: '50vh',
    margin: '90px 0',
    $nest: {
        '& .top-wave': {
            position: 'absolute',
            top: 0,
        },
        '& .top-title': {
            position: 'absolute',
            fontFamily: 'GothamBold',
            color: 'white',
            fontSize: '76px',
            top:0
        }
    }
})

export default HowItWorkStyle
